import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'

export class Nav extends Component {
    render() {
        return (
            <div>
                <nav className="main-nav">
                    <ul>
                    <li className="btn1"><NavLink to="/sun">Sun</NavLink></li>
                    <li className="btn2"><NavLink to="/stars">Stars</NavLink></li>
                    <li classname="btn3"><NavLink to="/moon">Moon</NavLink></li>
                    </ul>
                </nav>
            </div>
        )
    }
}

export default Nav
